function buildTableBody(data, headers, columns) {
  var body = [];

  body.push(headers);
  var sr = 1;
  data.forEach(function (row) {
    var dataRow = [];

    dataRow.push(sr.toString());
    sr++;

    columns.forEach(function (column) {
      dataRow.push(row[column].toString());
    });

    body.push(dataRow);
  });

  return body;
}

